description:
Category All Girl, Girl-Girl, Feature, Lesbian

 Director Nica Noelle
 Starring Samantha Ryan, Sinn Sage, Alyssa Branch, Maddy O'Reilly, Veronica Snow, Raven Rockette

 She was young and untamable, with a rare, dangerous beauty the fashion world wanted to exploit. But beneath the revelious veneer was a vulnerable lesbian, seduced by a dark world and the broken women who inhabited it. She was Gia, the unforgettable lesbian supermodel who burned too brightly and was gone too soon. (Not based on a true story)


